    ctemp[0] = aa->ants[irow]->polnType[0]; ctemp[1] = aa->ants[irow]->polnType[1]; ctemp[2] = 0;
    PyDict_SetItemString(dict, "polnType",     PyString_InternFromString(ctemp));

